import React from "react";
import "./About.css";
import Header from "../Header/Header";
import aboutVector from "./../../Assets/about_vector.png";
import FooterLink from "../FooterLink/FooterLink";

const About = () => {
    return (
        <div className="section-container">
            <Header
                heading="About Me."
                details="SEO | WordPress Developer | Digital Marketer | Obsessed with React.js"
            />
            <div className="about-main">
                <div className="about-main-left">
                    {/* Sub section one */}
                    <h3 className="about-sub-head">Teacher</h3>
                    <p className="about-details">
                        Teaching is my passion, till now, i have taught thousands of students about programming and Web Development.
                    </p>
                    {/* Sub section two */}
                    <h3 className="about-sub-head">Teacher</h3>
                    <p className="about-details">
                        Teaching is my passion, till now, i have taught thousands of students about programming and Web Development.
                    </p>
                    {/* Sub section three */}
                    <h3 className="about-sub-head">Teacher</h3>
                    <p className="about-details">
                        Teaching is my passion, till now, i have taught thousands of students about programming and Web Development.
                    </p>
                </div>
                <div className="about-main-right">

                </div>
            </div>

            <FooterLink
                phrase="Check out my "
                link="projects!"
                toAdress="/projects"
            />
            {/* Vector Frame */}
            <div className="vector-frame">
                <img src={aboutVector} className="about-vector" alt="about" />
            </div>
        </div>
    )
}

export default About;
